import React, { Component } from 'react';
import './pages.css'
import api from '../services/api';

class Ocorrencias extends Component {

    state = {
        search: '',
        users: [],
    };

    async componentDidMount(){
        const response = await api.get('users');
        this.setState({users: response.data});
        console.log(this.state.users);
    }


    handleChange = e => {
        this.setState({ [e.target.name]: e.target.value });
        console.log(e.target.value);
    }


    render(){

        function listar(){       
            var x = document.getElementById("btn-listar");
            x.style.display = "none";

            var y = document.getElementById("btn-cadastrar");
            y.style.display = "none";

            var z = document.getElementById("show-listar");
            z.style.display = "block";
        }

        return (
            <div id="app">
                <button onClick={listar} id="btn-listar">Listar</button>
                <button id="btn-cadastrar">Cadastrar</button>

                <div id="show-listar">
                    <input 
                        type="text"
                        name="search"
                        placeholder="Search ..."
                        onChange={this.handleChange}
                        value={this.state.search}
                    />

                    <section id="table">
                        <table>
                            <tbody>
                                <tr>
                                    <th>ID</th>
                                    <th>Name</th>
                                    <th>Email</th>
                                </tr>
                                <tr>
                                    <td>Alfreds Futterkiste</td>
                                    <td>Maria Anders</td>
                                    <td>Germany</td>
                                </tr>
                                <tr>
                                    <td>Centro comercial Moctezuma</td>
                                    <td>Francisco Chang</td>
                                    <td>Mexico</td>
                                </tr>
                                <tr>
                                    <td>Ernst Handel</td>
                                    <td>Roland Mendel</td>
                                    <td>Austria</td>
                                </tr>
                                <tr>
                                    <td>Island Trading</td>
                                    <td>Helen Bennett</td>
                                    <td>UK</td>
                                </tr>
                                <tr>
                                    <td>Laughing Bacchus Winecellars</td>
                                    <td>Yoshi Tannamuri</td>
                                    <td>Canada</td>
                                </tr>
                                <tr>
                                    <td>Magazzini Alimentari Riuniti</td>
                                    <td>Giovanni Rovelli</td>
                                    <td>Italy</td>
                                </tr>
                            </tbody>
                        </table>
                    </section>


                </div>
            </div>
        );
    }
}

export default Ocorrencias;
